import React, { useContext } from 'react';
import { ThemeContext } from '../';

const Detail = () => {
  const { theme } = useContext(ThemeContext);

  // Utilizar el parámetro dinámico de la URL para realizar la solicitud del usuario

  return (
    <div className={`detail ${theme}`}>
      <h1>User Detail</h1>
      {/* Mostrar la información detallada del usuario */}
    </div>
  );
};

export default Detail;
